import React from "react";
import SocialMediaCards from "./SocialMediaCards";
import ContactForm from "./ContactForm";

function ContactPage() {
  return (
    <>
    <h1 className="display-3">Contact</h1>
      <SocialMediaCards />
      <hr />
      <ContactForm />
    </>
  );
}

export default ContactPage;
